sys_variable_value.value:
(function execute(inputs, outputs) {
var userSysId = inputs.recordSysId || '';
var userQuery = inputs.originalQuery || '';
userQuery += userQuery == '' ? 'sys_id=' : '^ORsys_id=';
userQuery += userSysId;
outputs.query = userQuery;
})(inputs, outputs);

